import React from "react";
import "./Landing.css";

const Landing: React.FunctionComponent = () => {
  return (
    <div className="modal">
      <form>
        <label>Player Name</label>
        <input type="text" />
        <button onClick={() => console.log("modal button clicked")}>
          ENTER
        </button>
      </form>
    </div>
  );
};

export default Landing;
